biography.text:
With a name that echoes through the halls of music history, Robin Schulz has amassed a staggering array of achievements that have solidified his status as one of the industry&#39;s most successful artists. Across the past years, he has garnered over 800 Gold, Platinum, and Diamond awards in 30 countries. Now, two years after the release of his highly acclaimed album &#34;IIII,&#34; the Grammy-nominated DJ and producer is ready to unveil his fifth studio album, &#34;PINK.&#34;
Born and raised in a medium-sized German city with a population somewhere in the 160,000s and an excitement level that can be described as middle-rate at best, Schulz has transcended boundaries and become a global sensation. Traveling the world nonstop to play packed clubs, the world’s biggest festivals or his annual summer residency at Pacha, Ibiza, he captivates audiences with his electrifying performances. Schulz&#39;s fairytale-like success story began in 2014 when he first ascended to the top of worldwide singles charts with his acclaimed remix of &#34;Waves (feat. Mr. Probz)&#34; and landed his breakthrough global uber-hit “Prayer in C (feat. Lilly Wood &amp; The Prick)”. “Sugar (feat. Francesco Yates)” followed shortly after in 2015. That song recently made its entry into Spotify’s Billions Club. 

His immense popularity is further highlighted by over 20 million sales and an astonishing 12 billion streams worldwide.
